function delete_func(path) {
    let {expression} = path.node
    if (expression === undefined
        || expression.left === undefined
        || expression.left.property === undefined)
        return;
    if (expression.left.property.name === '$_Ai'
        || expression.left.property.name === '$_BE'
        || expression.left.property.name === '$_Cs'
        || expression.left.property.name === '$_DB'
    ) {
        path.remove()
    }
}

